import React from 'react';
import { createBrowserRouter } from 'react-router-dom';
import Layout from '../components/Layout/Layout';
import Testimonials from '../components/Testimonials';
import ContactForm from '../components/ContactForm';
import Cricket from '../components/Cricket/Cricket';
import Jaya9FooterText from '../components/Jaya9FooterText/Jaya9FooterText';
import CricketBattingFooter from '../components/CricketBattingFooter/CricketBattingFooter';
import Jaya9PlayFooter from '../components/Jaya9PlayFooter/Jaya9PlayFooter';
import BangladeshSeraCasino from '../components/BangladeshSeraCasiono/BangladeshSeraCasino';
import BissostoSeraFooter from '../components/BissostoSeraFooter/BissostoSeraFooter';
import Jaya9LotteryFooter from '../components/Jaya9LotteryFooter/Jaya9LotteryFooter';
import BangladeshCricketBonus from '../components/BangladeshCricketBonus/BangladeshCricketBonus';
import IbcSports from '../components/IbcSports/IbcSports';
import Home from '../components/Home/Home';
import LiveCasino from '../components/LiveCasino/LiveCasino';
import SlotGames from '../components/SlotGames/SlotGames';
import Sports from '../components/Sports/Sports';
import Lottery from '../components/Lottery/Lottery';
import Crash from '../components/Crash/Crash';
import Promotion from '../components/Promotion/Promotion';
import JayaRank from '../components/JayaRank/JayaRank';
import MachDhora from '../components/MachDhoa/MachDhora';

const router = createBrowserRouter([
  {
    path: '/',
    element: <Layout />,
    children: [
      
      { path: '/home', element: <Home /> },
      { path: '/cricket', element: <Cricket /> },
      { path: '/livecasino', element: <LiveCasino /> },
      { path: '/slotGames', element: <SlotGames /> },
      { path: '/slotGames', element: <Table /> },
      { path: '/sports', element: <Sports /> },
      { path: '/machdhora', element: <MachDhora /> },
      { path: '/lottery', element: <Lottery /> },
      { path: '/crash', element: <Crash /> },
      { path: '/promotion', element: <Promotion /> },
      { path: '/jayarank', element: <JayaRank /> },
      { path: '/jaya9footer', element: <Jaya9FooterText /> },
      { path: '/cricketbattingfooter', element: <CricketBattingFooter /> },
      { path: '/jaya9playfooter', element: <Jaya9PlayFooter /> },
      { path: '/bangladeshseracasino', element: <BangladeshSeraCasino /> },
      { path: '/ibcsports', element: <IbcSports /> },
      { path: '/bissoserafooter', element: <BissostoSeraFooter /> },
      { path: '/jaya9lotteryfooter', element: <Jaya9LotteryFooter /> },
      { path: '/bangladeshcricketbonus', element: <BangladeshCricketBonus /> },
    ],
  },
]);

export default router;
